/**
 * check answers in the data collection is not same as the set answers
 * @param {string} setQuestion target question
 * @param {object} setAnswer set answers
 * @returns true/false
 */
function findAnswersIsNotWithoutLoop(setQuestion, setAnswer) {
    // get answers in the data collection
    const getAnswer = this.S.getData(setQuestion);
    if (!getAnswer) return false;

    // get target option codes
    const setKeys = Object.keys(setAnswer);
    // get all option codes in the question and remove additional open-end
    const getKeys = Object.keys(getAnswer).filter((key) => {
        if (key.indexOf('@') === -1) {
            return key;
        }
    });
    // set return flag
    var flag = true;
    // lengths should be same
    if (setKeys.length !== getKeys.length) return false;
    // all answers should be exactly not same
    setKeys.forEach((key) => {
        if (setAnswer[key] === getAnswer[key]) {
            // one of the answer is same same then set flag to false
            flag = false;
        }
    });
    // return result
    return flag;
}

