/**
 * check target question is answered in the data collection or not
 * @param {string} question target question
 * @param {'single'|'multi'|'openEnd'} type target question type
 */
function checkAnsweredWithoutLoop(question, type) {
    // get answers in the data collection
    const answers = this.S.getData(question);
    if (!answers) return false;
    // get all option codes in the question and remove additional open-end
    const optionCode = Object.keys(answers).filter((key) => {
        if (key.indexOf('@') === -1) {
            return key;
        }
    });
    // set return flag
    var flag = true;
    // check if the question is answered or not
    switch (type) {
        case 'single':
            {
                optionCode.forEach((code) => {
                    // single question is not answered
                    if (answers[code] === null) {
                        flag = false;
                    }
                });
            }
        case 'multi':
            {
                // set default result to false
                flag = false;
                optionCode.forEach((code) => {
                    // multi question is not answered
                    if (answers[code] !== 0) {
                        flag = true;
                    }
                });
            }
        case 'openEnd':
            {
                // set default result to false
                flag = false;
                optionCode.forEach((code) => {
                    // multi question is not answered
                    if (answers[code] !== null) {
                        flag = true;
                    }
                });
            }
    }
    // return result
    return flag;
}

