function findAnswerInQuestion(setQuestion, setAnswer, operator) {
    const getAnswer = this.S.getData(setQuestion);
    if (!getAnswer) return false;
    const setKeys = Object.keys(setAnswer);
    const getKeys = Object.keys(getAnswer);
    var flag = true;
    switch (operator) {
        case 'is':
            {
                if (setKeys.length !== getKeys.length) return false;
                setKeys.forEach((key) => {
                    if (setAnswer[key] !== getAnswer[key]) {
                        flag = false;
                    }
                });
                return flag;
            }
        case 'is not':
            {
                if (setKeys.length !== getKeys.length) return false;
                setKeys.forEach((key) => {
                    if (setAnswer[key] === getAnswer[key]) {
                        flag = false;
                    }
                });
                return flag;
            }
        case 'contains':
            {
                if (setKeys.length >= getKeys.length) return false;
                setKeys.forEach((key) => {
                    if (setAnswer[key] !== getAnswer[key]) {
                        flag = false;
                    }
                });
                return flag;
            }
        case "doesn't contain":
            {
                if (setKeys.length >= getKeys.length) return false;
                setKeys.forEach((key) => {
                    if (setAnswer[key] === getAnswer[key]) {
                        flag = false;
                    }
                });
                return flag;
            }
    }
}

