function randomize(options) {
    var index = -1,
        size = options.length,
        lastIndex = size - 1;
    while (++index < size) {
        var rand = index + Math.floor(Math.random() * (lastIndex - index + 1));
        var value = options[rand];
        options[rand] = options[index];
        options[index] = value;
    }
    options.length = size;
    return options;
}

