function scriptLogic(script_id, args, return_type, operator, result) {
    if (typeof (result) === "string" && return_type !== "string") {
        switch (return_type) {
            case "boolean":
                if (result === "true") {
                    result = true
                }
                else if (result === "false") {
                    result = false;
                }
                else {
                    throw new Error(`Cannot convert "${result}" to a Boolean`);
                }
                break;
            case "number":
                result = Number(result);
                break;
            default:
                throw new Error(`Invalid return_type: ${return_type}`);
        }
    }
    const getResult = this.S.execScriptItem(script_id, args);
    switch (operator) {
        // Allows two booleans or strings to compare size
        case ">":
            return getResult > result;
        // Allows two booleans or strings to compare size
        case "<":
            return getResult < result;
        case "=": case "is":
            return getResult === result;
        case "is not":
            return getResult !== result;
        default:
            throw new Error(`Unsupported operator: "${operator}"`)
    }
}

